INSERT INTO `blog` (`id`, `titolo`, `descrizione`, `image`, `data`) VALUES
(1, 'Natale con TEDxSapienzaU: un albero condiviso e mille idee appese ai rami', 'L’aria natalizia si è sparsa ovunque negli ultimi giorni ed è arrivata fino alla nostra Università. In Sapienza le lezioni continuano come sempre ma c’è qualcosa in più a remare contro il freddo di queste giornate. Stiamo parlando dell’albero di Natale di TEDxSapienzaU e del suo stand. Quest’anno, infatti, la squadra di volontari dell’evento ha deciso di coinvolgere l’intera comunità studentesca in un progetto speciale: scambiarsi auguri e idee di valore. \r\nTutto ciò ha preso forma in modo semplice. Nelle giornate del 20 e 21 dicembre, davanti al CIAO in Città Universitaria, gli studenti sono stati invitati ad appendere ai rami dell’albero tanti bigliettini in cui avevano scritto un’idea, un progetto, una speranza da condividere.\r\nUn modo, questo, non solo per far conoscere la realtà di TEDxSapienzaU a quegli studenti che per qualche motivo ne erano ancora distanti, ma per concretizzare sempre più lo spirito dell’associazione.  La condivisione, in questo caso, è al centro di tutto, ed è un elemento che ci accomuna con il Natale. \r\nSe si ha un’idea che vale è bello metterla a disposizione di tutti, proprio come quando gli speaker diffondono le loro conoscenze sul palco del TED.\r\nCreare nuovi legami, imparare qualcosa di nuovo e guardare oltre i propri occhi: sono state due giornate ricche di valore, sia per i volontari del team che per chiunque sia passato davanti al nostro stand.\r\nÈ un periodo frenetico, quello che viviamo, e per gli studenti con la sessione alle porte lo stress si fa sentire particolarmente. Prendersi un momento per fermarsi, incuriosirsi, mangiare un pezzo di panettone in compagnia e chiedersi cos’è che ha davvero valore serve a riequilibrarsi. Un concetto che, comunque, va oltre l’Università e ci riguarda tutti. ', , '2023-02-12');
INSERT INTO `blog` (`id`, `titolo`, `descrizione`, `image`, `data`) VALUES
(2, 'Essere artisti nel mondo degli NFT: l’autenticità restituisce valore ai digital artists', '“Andare oltre è uno degli elementi fondamentali delle mie opere: chiunque può andare oltre quello che comunemente immagina e chiunque può reinventare il conosciuto per plasmare il nuovo”\r\nCosì parla Giusy Amoroso, director e digital artist, che ha iniziato la sua formazione seguendo sociologia all’Università Sapienza di Roma per poi invertire rotta con un’Accademia e un Master che trattavano, tra le altre cose, il design del prodotto e le riproduzioni architettoniche. Tutto per approdare, alla fine, all’universo dell’arte digitale e della virtual reality. \r\n\r\nGiusy racconta di essere sempre stata una persona timida e introversa ma di aver trovato nell’arte lo strumento per comunicare i suoi mondi interiori e le storie che ne derivano. Nel suo speech ci fa capire quanto essere artista le abbia permesso di potersi esprimere liberamente a livello creativo e di vivere della propria passione, che è qualcosa da non dare mai per scontato. Mentre parla delinea le tappe del suo percorso per raggiungere la libertà creativa ed espressiva.\r\n\r\nTra i temi principali del suo speech ci sono gli NFT, con cui Giusy entra in contatto nel 2020 e che per lei rappresenteranno un cambiamento importante. Si tratta dell’acronimo di “non-fungible token”, che in italiano potrebbe essere tradotto in “gettone non copiabile”, ovvero \r\n\r\nqualcosa di unico, che non può essere sostituito da altro. Se definiamo “token” una risorsa digitale, gli NFT ne sono una tipologia specifica, che rappresenta l’atto di proprietà ed il certificato di autenticità di un bene unico digitale o fisico. La blockchain, in italiano “catena di blocchi”, è il luogo virtuale in cui i non-fungible token sono scritti e l’unico in cui possono essere identificati. In base a questi principi, gli NFT non sono intercambiabili.\r\n\r\nI non fungible token, tra le altre cose, possono riferirsi alle opere d’arte digitali. \r\nQuesto, spiega Giusy, è di fondamentale importanza: la garanzia di autenticità è fondamentale nel mondo del collezionismo. È l\'inizio di un nuovo mondo per i digital artists: si iniziano a concepire le opere create con l’ausilio di supporti tecnologici come altrettanto importanti rispetto a quelle create in maniera tradizionale. \r\n\r\nQuando Giusy parla di “andare oltre” si riferisce anche alle sue esperienze psichedeliche, definendole momenti di fondamentale importanza per il suo sviluppo creativo. Per la speaker si tratta di esperienze profonde ed importanti, che consiglia di fare con consapevolezza.\r\n\r\n“Mi hanno fatto capire che la realtà che ci circonda può cambiare anche drasticamente rispetto al senso comune. (...) Con queste esperienze rivendichiamo un’identità completa. (...) Ci identifichiamo con il creato o con il principio creativo stesso”\r\n\r\nPer arte psichedelica si intende qualsiasi tipo di arte visiva ispirata alle esperienze psichedeliche. L’ispirazione artistica, in questi casi, viene proprio dall’alterazione della coscienza prodotta dalle sostanze. \r\n\r\nPsichedelia e virtual reality, spirituale e tecnologico: non sono dimensioni così diverse, hanno anzi molto in comune, per esempio il mutamento dei limiti della realtà cosciente e l’evocazione di percorsi interiori trasformativi.\r\n\r\n“Adesso, finalmente, posso definirmi un’artista full-time, con il tempo da dedicare a me stessa, alla mia arte, e a cercare nuove forme di ispirazione” \r\nUn discorso, il suo, che spinge gli ascoltatori a non farsi abbattere dagli errori, e anzi proprio da quelli ripartire. A fronte delle difficoltà e di quello che potrebbero dire gli altri, se si hanno un sogno e una passione bisogna provarci fino alla fine. Se ci si sente artisti, insomma, bisogna essere artisti. ', , '2023-02-01');
INSERT INTO `blog` (`id`, `titolo`, `descrizione`, `image`, `data`) VALUES
(3, 'Progresso: antiche istruzioni per l’uso', 'Serena, classicista appassionata e studentessa del nostro Ateneo, ci parla di progresso scientifico partendo da lontano e approfondendo l’insieme di intuizioni e verità celate dietro secoli di evoluzioni e scoperte.\r\n\r\nAttraverso le sue parole, permette di andare a fondo, di scavare tra i pensieri di un autore come Senofane di Colofone, che già dal VI secolo a.C. ci offre con pochi versi una prima definizione di progresso occidentale moderno:\r\n\r\n“Gli dèi non hanno dato ai mortali ogni cosa, ma essi ricercando trovano di volta in volta il meglio”\r\nLa Spanò racconta quanto l’autore seppur distante da noi, per cultura, epoca storica, area geografica, comunichi efficacemente una chiara idea di progresso; un progresso collettivo, definito come una continua ricerca di ciò che di volta in volta possa poi essere considerato il meglio per una comunità.\r\n\r\n“Senofane non ci sta dando delle informazioni o dei dati precisi, ma vi assicuro che il suo pubblico aveva perfettamente compreso e condiviso il suo pensiero”. \r\n\r\nPerché vi chiederete? Perché una comunicazione efficace arriva ad \r\n\r\n“oltrepassare il tempo e lo spazio” \r\nspiega Serena. \r\n\r\nMa come comunicare il progresso? In che modo far sì che il nostro stile di comunicazione risulti valido e che non si traduca in una mera trasmissione di nozioni?\r\n\r\nLo stesso concetto viene riportato alla luce dal filosofo Hans Jonas, che nel suo saggio sul Principio di Responsabilità della Scienza, affida all’uomo il compito di integrare nelle sue azioni un elemento focale: l’empatia. \r\n\r\n\"Agisci in modo tale che gli effetti della tua azione siano compatibili con la continuazione di una vita autenticamente umana\". \r\n\r\nProprio questo l’assunto fondamentale dell\'Etica della Responsabilità.\r\n\r\nSecondo lo stesso, per quanto l’uomo abbia imparato a controllare la natura a suo piacimento e abbia la capacità di plasmare ciò che lo circonda, spesso trascura il fattore etico legato alla comunità. \r\n\r\nNegli anni, l’etica collettiva, il pensiero rivolto al prossimo, ha gradualmente lasciato spazio ad un progresso di tipo individuale, intimo, racchiuso tra le mura di un laboratorio.\r\n\r\nSerena cita il periodo pandemico, parlando di un vero e proprio “disastro” comunicativo, che ha finito per incutere timore, diffondendo panico e ignoranza.\r\n\r\n“Perché il progresso non è più a diretto contatto con la comunità, perché è soltanto quell’empatia, quella particolare condivisione di valori positivi e soggettivi a rendere una comunicazione efficace e ogni ambito del sapere attivamente partecipe”.', , '2023-02-01');

